script: |
  super -f text -I q9407.spq | sort > q9407.out

inputs:
  - name: q9407.spq
    data: |
      SELECT DISTINCT + col1 * - 12 AS col2, col0, + + col0 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN - 56 + + col2 - 21 * - - col1 AND ( + 33 );
  - name: tab1

outputs:
  - name: q9407.out
    data: |
